import copy

class Solution(object):
    def cnt(self, start, s, words, strmap):
        add = len(words[0])
        cnt = 0
        ans = []

        posstack = []
        cntmap = {}
        while start + add - 1 < len(s):
            now = s[start: start + add]
            if now not in strmap:
                cntmap = {}
                posstack = []
            else:
                if cntmap.has_key(now) == False:
                    cntmap[now] = 0
                nowValue = cntmap[now]
                if nowValue < strmap[now]:
                    cntmap[now] += 1
                    posstack.append(now)
                else:
                    while posstack[0] != now:
                        cntmap[posstack[0]] -= 1
                        posstack.pop(0)
                    posstack.pop(0)
                    posstack.append(now)
            if len(posstack) == len(words):
                ans.append(start - (len(words) - 1) * add)
            start += add
        return ans

    def findSubstring(self, s, words):
        """
        :type s: str
        :type words: List[str]
        :rtype: List[int]
        """
        if len(words) == 0:
            return []

        strmap = {}
        for w in words:
            if strmap.has_key(w):
                strmap[w] += 1
            else:
                strmap[w] = 1
        ans = []

        for i in range(0, len(words[0])):
            ans.extend(self.cnt(i, s, words, strmap))
        return ans

